import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';

const Community = () => {
  return (
    <>
      <Head>
        <title>커뮤니티 | moving</title>
      </Head>
      <AppLayout>커뮤니티 게시판</AppLayout>
    </>
  );
};

export default Community;
